import React, { Component } from "react";
import Button from "react-bootstrap/Button";
export default class Card extends Component {
  state = {};
  componentDidMount = () => {};
  constructor(props) {
    super();
    console.log(props.val);
  }
  render() {
    return (
      <div>
        <Button>{this.props.value}</Button>
      </div>
    );
  }
}
